import Form from "./Form";
import List from "./List";
import React, { useState, useEffect } from "react";

function Contacts() {
  const [contacts, setContacts] = useState([]);

  useEffect(() => {}, [contacts]);

  return (
    <div>
      <List />
      <Form setContacts={setContacts} contacts={contacts} />
    </div>
  );
}

export default Contacts;
